import './App.css';

function App() {
  const mensaje = 'Hola'
  const a = 2
  const b = 3
  return (
    <div className="App">
      {+new Date()}
      <h1>Titulo de la App</h1>
      <strong>Estamos trabajando en ello</strong>
      <div>
        <p>El resultado es:</p>
        {a + b}
      </div>
    </div>
  );
}

export default App;
